import saveDataToLocalStorage from "./Save";

const saveUserData = (name, id, patient_or_doc) => {
    const user = { 
        name: name, 
        id: id,
        patient_or_doc: patient_or_doc
    };
    saveDataToLocalStorage('user', user);
};

export default saveUserData;
